import React from 'react';
import s from './main.module.css'

const Main = (props) => {
    return (
        <div className={s.header}>
            <div>- RESTORATION -</div>
            <div>Что такое реставрация</div>
            <div>Расчитать стоимость</div>
            <div>Оставить заявку</div>
        </div>
    )
}
export default Main;
